    return (
      <Fragment>
        {/* <h1>use redux, counter : {counter}</h1> */}
        <Router>
          <Header />
          <Switch>
            <Route exact path="/" component={BlogLists} />

            <Route path="/category/:category" component={BlogLists} />

            <Route path="/read/:title/" component={Read} />

            <Route path="/login" component={Login} />
          </Switch>
          <Footer />
        </Router>
      </Fragment>
    );
  }
}

export default App;
